def testListRepetition(origin_list: list = []):
    set = {item for item in origin_list}
    print("origin_list.__len__() = ", origin_list.__len__(), "set.__len__() = ", set.__len__(),
          "duplicate count = ", origin_list.__len__() - set.__len__())


def getNumberList(start_index=1, end_index=10, step=1):
    retlist = []
    for i in range(start_index, end_index, step):
        retlist.append(i)
    return retlist


def getNumberLists(start_index=1, end_index=1000, step=100):
    retlist = []
    for i in range(start_index, end_index, step):
        retlist.append(getNumberList(start_index, i, 1))
    return retlist

